import styled from "styled-components";
// import { Link } from "react-router-dom";

export const Sidebar = styled.div`
  display: grid;
  background-color: red;
  grid-area: sidebar;
  grid-template-columns: 1fr;
  grid-template-rows: 0.5fr 1fr;
  grid-template-areas:
    "top-bar"
    "bottom-bar";
`;
